import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import App from './App';
import './index.css';
import 'tachyons';
import { robots } from './robots';

ReactDOM.render(
  <CardList robots={robots}/>,
  document.getElementById('root')
);
